import React from "react";
import './App.css';
import images from './components/img.js'
import header from './components/header.js';
import card from './components/card.js';
import menu from './components/menu.js';


function App() {
  return (
    <div class="container">
      {header()}
      <main>
        <div class="row">
          <div class="col">
            {menu()}
            {card()}
          </div>
          <div class="col">
            <img src="https://открыватор.москва/file/2015/10/karta-moskvi.jpg" height="400px" />
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
